import React from "react";
import AddButton from "../button/AddButton";
import CourseInput from "../input/CourseInput";

import "./CourseLayer.css";

const DUMP_DATA = [
  { key: 1, value: "Read a book" },
  { key: 2, value: "Cook lunch" },
  { key: 3, value: "Go to the shopping" },
];
const CourseLayer = () => {
  return (
    <div className="course">
      {DUMP_DATA.map((data) => {
        <h2 key={data.key}>{data.value}</h2>;
      })}
    </div>
  );
};

export default CourseLayer;
